import React from 'react';
import AwesomeSlider from 'react-awesome-slider';
import Nav from '../components/nav';

const Home = () => (
  <div>
    <Nav />
    <AwesomeSlider>
      <div>1</div>
      <div>2</div>
      <div>3</div>
    </AwesomeSlider>
  </div>
);

export default Home;
